import React from 'react'
import useToggle from '../hooks/use-toggle'
function Test() {
  const [toggle, setToggle]= useToggle(true)
  return (
    <div className='app'>
      <h1>Test toggle</h1>
      <button onClick={setToggle}>toggle</button>
    {toggle && <h2>{toggle.toString()}</h2>}
    {!toggle && <h2>{toggle.toString()}</h2>}
    </div>
  )
}

export default Test
